import './Formulario.css'
import { CrearProducto } from './crearProducto';
import {ModificarProducto} from './modificarProducto'

export const Formulario = ({action}) => {

    return(
        <div>
            {action === 'crearP' ? <CrearProducto /> : <ModificarProducto />}
        </div>
    )
};
